import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";
import logo from "../assets/logo.png"; // updated path to your logo

const Navbar = () => {
  const [active, setActive] = useState(null);

  const showMenu = (name) => setActive(name);
  const hideMenu = () => setActive(null);

  return (
    <header>

      {/* TOP STRIP */}
      <div className="topbar">

        {/* LOGO + NAME + TAGLINE */}
        <div className="logo-section">
          <img src={logo} alt="RGM Logo" className="logo-img" />
          <div className="logo-text">
            <h2>RGM Line Haul Inc.</h2>
        
          </div>
        </div>

        {/* RIGHT LINKS */}
        <div className="right-links">
          <Link to="/equipment">Equipment</Link>
          <Link to="/careers">Careers</Link>
          <Link to="/gallery">Gallery</Link>
          <Link to="/contact">Contact</Link>
          <Link className="black-btn" to="/login">Login</Link>
        </div>
      </div>

      {/* NAVBAR MENU */}
      <nav className="main-nav">
        <ul className="right-nav">

          <li onMouseEnter={() => showMenu("drive")} onMouseLeave={hideMenu}>
            <span>Drive for RGM ▾</span>
            {active === "drive" && (
              <div className="dropdown">
                <Link to="/drive/company">Company Drivers</Link>
                <Link to="/drive/owner">Owner Operators</Link>
                <Link to="/drive/training">Training</Link>
              </div>
            )}
          </li>

          <li onMouseEnter={() => showMenu("transport")} onMouseLeave={hideMenu}>
            <span>Transportation Solutions ▾</span>
            {active === "transport" && (
              <div className="dropdown">
                <Link to="/transport/flatbed">Flatbed</Link>
                <Link to="/transport/dryvan">Dry Van</Link>
                <Link to="/transport/oversize">Oversize & Heavy</Link>
              </div>
            )}
          </li>

          <li onMouseEnter={() => showMenu("logistics")} onMouseLeave={hideMenu}>
            <span>RGM Logistics ▾</span>
            {active === "logistics" && (
              <div className="dropdown">
                <Link to="/logistics/services">Logistics Services</Link>
                <Link to="/logistics/network">North American Network</Link>
              </div>
            )}
          </li>

          <li onMouseEnter={() => showMenu("carriers")} onMouseLeave={hideMenu}>
            
            {active === "carriers" && (
              <div className="dropdown">
                <Link to="/carriers/partners">Partner Carriers</Link>
                <Link to="/carriers/support">Carrier Support</Link>
              </div>
            )}
          </li>

          <li onMouseEnter={() => showMenu("company")} onMouseLeave={hideMenu}>
            <span>Our Company ▾</span>
            {active === "company" && (
              <div className="dropdown">
                <Link to="/about">About Us</Link>
                <Link to="/leadership">Leadership</Link>
                <Link to="/culture">Company Culture</Link>
              </div>
            )}
          </li>

        </ul>
      </nav>

    </header>
  );
};

export default Navbar;
